INSERT INTO `promotion_article` VALUES (5, 3, 0, '常见问题', '', 'http://127.0.0.1:48080/admin-api/infra/file/4/get/d1cc3a2488c6e4253d5c9c360534c3c87156815b3f92554002211f2d7764d294.jpeg', '', '0', 0, 0, b'0', b'0', '<h2>① 商品退货了，谁承担运费？</h2><p>亲，平台运费规则秉承“谁过错，谁承担”的原则,如非商家或者物流问题，建议您联系商家协商处理，售后，退货运费需要您自行承担;如商品存在质量问题、商家发错货等情况，退货运费由商家承担。为了更好的保障您的权益，请您保留好相关凭证,退货物流费用麻烦您先垫付，不要使用到付，待商家收到您寄回的商品，退款成功后，您可以凭借凭证联系商家处理~</p><h2>② 付款后订单显示待付款？</h2><p>如您账户显示已扣款，但订单交易状态显示”等待付款”，可能是由于网络繁忙导致数据延迟，建议您稍后关注订单交易状态以及交易账户流水情况。</p><h2>③ 发货时间？</h2><p>一般情况下，用户下单后48小时内发货</p>', '1', '2023-12-27 22:05:57', '1', '2023-12-27 22:05:57', b'0', 1);
